    <Link to = {`/property/${id}`}>
       
          <img  src={image} alt="srgdvfh"/>   
      

      <div className="propertyContent">
      <h3>{title}</h3>
          <p>{price} per night</p>
         
      </div>
      </Link>
      
  </div>

  );
};

